    [Test]
    public void TestGebouwenFunenparkProperty()
    {
        GeoJSON geojson = new GeoJSON(testGebouwenFunenpark);
        geojson.GotoNextFeature();
        var val1 = geojson.GetPropertyFloatValue("#Opacity");
        Assert.AreEqual(100, val1);

        var val2 = geojson.GetPropertyStringValue("#LayerName");
        Assert.AreEqual("20210930 MV 3D Model Marineterrein_buildings", val2);

        var val3 = geojson.GetPropertyFloatValue("Number_of_Storeys");
        Assert.AreEqual(4, val3);

        var poly = geojson.GetPolygon();
        Assert.AreEqual(1, poly.Count);
        Assert.AreEqual(5, poly[0].Count);

        var first = poly[0][0];
        Assert.AreEqual(4.931155989066799, first.x );
        Assert.AreEqual(52.368934929307486, first.y);

    }

